import "./App.css";
const GroceryList = () => {
  let grocery;

  const handleItemChange = input => {
    grocery = input;
    console.log(grocery);
  };
  return (
    <div>
      <h1>grocery</h1>
      <div className="add-grocery-item">
        <input
          type="text"
          placeholder="Add a grocery..."
          onChange={event => handleItemChange(event.target)}
        />
        <button type="submit">ADD</button>
      </div>
      {grocery}
    </div>
  );
};

export default App;
